INSERT INTO `drills` VALUES (1,'Pase in sir indian','<p>Grupe de 5-8 copii alearga in sir indian. Mingea este pasata in spate de la un jucator la altul. Dupa pasa, jucatorul se retrage cu spatele, la coada sirului si exercitiul continua pana la fluierul antrenorului (STOP). Pasele pot fi de mai mult tipuri: pasa simpla, pasa printre picioare, pasa din offload.</p>\r\n<p><strong>Fun</strong>: concurs</p>','2022-06-11 05:00:18','2023-02-11 21:15:46',NULL,''),(2,'Flipball','In doua echipe, jucatorii arunca cu mingii de rugby intr-o minge de fotbal. Scopul e ca mingea sa ajunga in terenul echipe adverse','2022-06-11 05:01:13','2023-02-09 21:41:04',NULL,''),(3,'Pase si alergare in suport','<p>Grupe de trei copii. Purtatorul de balon alegere cui sa paseze, stanga sau dreapta. Jucatorul care primeste ii paseaza ultimului membru al grupei, care marcheaza eseul. Cel care marcheaza eseul devine purtator de balon.</p>\r\n<p>FUN: Concurs.</p>\r\n<p>IMPLICARE: Dau momentul plecarii. Au grija ca grupa sa nu plece prea repede (pericol de a se incurca cu grupa din fata) sau prea incet (pierd vremea si intarzie plecarea altor grupe). La concurs, ajuta stabilirea castigatorului si dau startul.</p>','2022-06-27 15:07:51','2023-04-09 16:28:55',NULL,''),(4,'Pase in perimetru','In functie de numarul de jucatori, ce face un perimetru. Fiecare jucator are 1mp la inceput. Grupe de trei aleaga in cadrul perimetrului si paseaza cat mai repede, in spate. Jucatorii trebuie sa aiba grija sa nu iasa din perimetru.\r\n\r\nLa semnal (ATENTIE. PASA), trebuie  sa paseze, 1-2 m in afara perimetrului la o tinta de pe margine\r\n\r\nFUN: micsoram dimensiunea terenului, marim distanta pasei externe.\r\n\r\nIMPLICARE: Au grija ca jucatorii sa nu iasa din perimetru. Primesc pase din interirorul perimetrului.','2022-06-27 15:09:13','2022-06-27 15:09:13','',''),(5,'Pase din contact (offload)','O perna la 8-10 jucatori. In grupe de cate 2, purtatorul de balon, ia contact si incearca sa paseze colegului de grupa.\r\n\r\nPentru o dificultate sporita, se lucreaza in grupe de 3. Al doilea om ii paseaza celui de-la treilea care vine lansat.\r\n\r\nIMPLICARE: Dau startul grupelor urmatoare','2022-06-27 15:09:47','2023-02-09 21:39:47',NULL,''),(6,'Joc cu tema offload','Se fac echipele. Scopul jocului e de a faca cat mai multe off-loaduri. Un off-load se considera bun daca jucatorul care a primit pasa castiga teren in urma offloadului.','2022-06-27 15:10:35','2022-06-27 15:10:35','',''),(7,'Orange tapes speed','In perechi de cate doi, se trece banda portocalie peste mijlocul fiecarui jucator. Cel din fata sprinteaza, in timp ce al doilea incearca sa ramana pe loc.','2023-02-11 20:26:17','2023-02-11 20:26:17',NULL,''),(8,'Accelerare, decelerare','Jucatorii accelereaza, decelereaza, apoi accelereaza din nou.','2023-02-11 20:29:36','2023-02-11 20:29:36',NULL,''),(9,'Lupul in haine de oaie','Jucatorii se afla in centrul unui perimetru (cerc, patrat, dreptunghi) si stau un ochi inchisi. Antrenorul se plimba printre ei si atinge pe unul dintre ei, care devine lup, apoi ii informeaza pe toti ca pot deschide ochii. Jucatorii trebuie sa adune trei conuri, imprastiate in perimetru, pentru a avea voie sa iasa din el si sa se salveze de lup','2023-02-11 20:31:17','2023-02-11 20:31:17',NULL,''),(10,'Sticluta cu otrava','Un jucator se afla in mijlocul grupului. Restul jucatorilor il tin de un deget. Jucatorul din mijloc anunta diferite sticlute: sticluta cu cafea, sticluta cu cerneala, etc. Cand anunta sticluta cu otrava, restul jucatorilor trebuie sa fuga, iar el trebuie sa prinda cat mai multi pana sa ajunga in afara unui perimetru stabilit inainte.','2023-02-11 20:36:00','2023-02-11 20:36:00',NULL,''),(11,'X si 0','<p>Doua echipe sprinteaza pana la un careu de X si 0. Acolo trebuie sa puna un con sau un tricou intr-o casuta existenta. Castiga echipa care face prima o linie de 3 conuri. Daca toate casutele s-au ocupat si nimeni nu a castigat, la o tura poti pune un con nou sau poti scoate un con al echipe adverse</p>','2023-02-11 20:41:25','2023-10-29 16:32:22',NULL,''),(12,'Cat e ora lupule?','Jucatorii intreaba “Cat e ora lupule?”, iar lupul spune exercitiul care trebuie facut. De exemplu, genunchii la piept, sarituri de iepure, sarituri de broscuta, sarituri intr-un picior, joc de glezne. Lupul mai poate spune ca e o ora mesei, moment in care jucatorii  trebuie sa sprinteze in afara perimetrului in care se afla.','2023-02-11 20:42:13','2023-02-11 20:42:13',NULL,''),(13,'Baseball','Baseball. Se poate juca cu bate si mingii de baseball sau prin pasarea mingiilor pentru a fi lovite cu mana  sau cu piciorul.','2023-02-11 20:43:55','2023-02-11 20:43:55',NULL,''),(14,'Linii de conuri dupa sprint','16 conuri, cate 4 de o culoare diferita sunt asezate aleator sa formeze un patrat. Jucatorii trebuie sa sprinteze pana la conuri si sa inlocuiasca doua conuri alaturate pentru a forma 4 linii  de conuri de aceeasi culoare','2023-02-11 20:46:07','2023-02-11 20:46:07',NULL,''),(15,'Super Mario','<p>Cursa cu obstacole.</p>\r\n<p>Doi voluntari paseaza de la unul la celalalt colacul de placaj. Jucatorul trebuie sa arunce mingea in asa fel incat sa loveasca colacul. Trei incercari nereusite sunt penalizate cu 5 flotari.</p>\r\n<p>Jucatorul trebuie sa suteze printr-o poarta si sa recupereze mingea de partea cealalta si apoi sa o duca la un con.</p>\r\n<p>Un voluntar trebuie sa invarta o minge gonflabila legata cu o sfoara deasupra capului, iar jucatorii trebuie sa se fereasca. Daca sunt atinsi, sunt penalizati cu 3 genoflexiuni.</p>\r\n<p>Pe o portiune de traseu prestabilita, jucatorul trebuie sa arunce o minge in sus si sa o prinda. Daca scapa mingea e penalizat cu trei coreene.</p>\r\n<p>Jucatorul trebuie sa astepte in zona \"de primire\" o pasa de la un voluntar. Daca o scapa e penalizat cu trei ridicari de bazin.</p>\r\n<p>&nbsp;</p>','2023-02-11 20:46:31','2023-06-10 16:11:06',NULL,''),(16,'Sprint la culoare','Jucatorii alearga la conul de culoarea indicata de antrenor.','2023-02-11 20:47:19','2023-02-11 20:47:19',NULL,''),(17,'Finest of Freddy','Finest of Freddy. Esti intr-o casa si trebuie sa aduni anumite conuri, ferindu-te de un adversar.','2023-02-11 20:49:18','2023-02-11 20:49:18',NULL,''),(18,'Muta conuri/mingii dintr-o parte in alta viteza vs team work','Cat de repede se pot muta niste obiecte dintr-o parte in alta.','2023-02-11 20:50:49','2023-02-11 20:50:49',NULL,''),(19,'Teleportare','Jucatorii sar in cercuri ca broasca. Ei sunt ajutati de colegii lor care ridica cercul si-l muta mai departe.','2023-02-11 20:51:15','2023-02-11 20:51:15',NULL,''),(20,'Sarituri intr-un picior','<p>Satiruri intr-un picior de-a lungul unei sfori intinse in diferite forme (nu in linie dreapta).</p>\r\n<p><strong>Fun:&nbsp;</strong>Concurs. Dupa ce primul participant trece de o linie de conuri, al doilea participant pleaca si incearca sa-l prinda.</p>','2023-02-12 21:17:35','2023-02-12 21:17:35',NULL,''),(21,'Touch','<p>Touch game</p>','2023-02-12 22:41:15','2023-02-12 22:41:15',NULL,''),(22,'Shuttle Battle',NULL,'2023-03-04 17:54:56','2023-03-04 18:53:05','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Shuttle Battle! ???<br><br>High intensity 1 v 1 challenge that incorporates a range of fitness components.<br><br>Make it a team activity with the next team-mates replacing the tennis balls.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/wcZKSQI4dy\">pic.twitter.com/wcZKSQI4dy</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1631536603079344128?ref_src=twsrc%5Etfw\">March 3, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(23,'Evasion Game',NULL,'2023-03-04 19:09:28','2023-03-04 19:11:27','<iframe src=\"https://www.facebook.com/plugins/video.php?height=476&href=https%3A%2F%2Fwww.facebook.com%2FRugbyToolbox%2Fvideos%2F218367697268443%2F&show_text=false&width=380&t=0\" width=\"380\" height=\"476\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowFullScreen=\"true\"></iframe>',''),(24,'Around the world',NULL,'2023-03-07 21:04:20','2023-03-07 21:04:20','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Two Ways Around the World! ???<br><br>Team building activity to encourage cooperation and communication.<br><br>Separate the two conditions initially before combining. Fastest team wins!<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/pXGsccvRO2\">pic.twitter.com/pXGsccvRO2</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1632620200343289856?ref_src=twsrc%5Etfw\">March 6, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(25,'Circle Catchup',NULL,'2023-03-07 21:30:59','2023-03-07 21:30:59','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Circle Catchup?? <br><br>?️ aim of the game if for ? Team’s ball to overtake ? Team’s ball. <br><br>?️ focus on quick hands and accurate passes. <br><br>?️ change direction of pass.<br><br>Great Netball activity but transferable to:<br>? Basketball <br>? Rugby <br>? Handball <br><br>Please retweet if useful ? <a href=\"https://t.co/nVcLo5WuhO\">pic.twitter.com/nVcLo5WuhO</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1630819301157638145?ref_src=twsrc%5Etfw\">March 1, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(26,'Acceleration',NULL,'2023-03-07 21:34:52','2023-03-07 21:34:52','<iframe src=\"https://www.facebook.com/plugins/video.php?height=476&href=https%3A%2F%2Fwww.facebook.com%2FRugbyToolbox%2Fvideos%2F141006287839661%2F&show_text=false&width=476&t=0\" width=\"476\" height=\"476\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowFullScreen=\"true\"></iframe>',''),(27,'Piatra, hartie, foarfeca, varianta agilitate',NULL,'2023-03-11 21:29:19','2023-03-11 21:29:19','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Rock, Paper, Scissors 1v1! ??✂️<br><br>First team to successfully make their way along their path to the end is the winner.<br><br>Several mini matches running at once to avoid queues going past that golden 8 seconds.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/S9jhhj1G7I\">pic.twitter.com/S9jhhj1G7I</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1634465870595473409?ref_src=twsrc%5Etfw\">March 11, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(28,'Chain race',NULL,'2023-03-11 21:34:13','2023-03-11 21:34:13','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Chain Race! ⛓️??‍♀️?<br><br>Team race activity begining with a single player and the chain builds after every shuttle.<br><br>Tactical decisions can be made in the order of runners, especially when fatigue starts to kick in! ? <a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/foObg7nVxN\">pic.twitter.com/foObg7nVxN</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1634463897372577793?ref_src=twsrc%5Etfw\">March 11, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(29,'Gaga ball',NULL,'2023-03-14 21:23:53','2023-03-14 21:23:53','<blockquote class=\"twitter-tweet\"><p lang=\"es\" dir=\"ltr\">Juegos del mundo, que buena idea para trabajar la interculturalidad en clase de educación física.<a href=\"https://twitter.com/hashtag/EDUCAM23?src=hash&amp;ref_src=twsrc%5Etfw\">#EDUCAM23</a> <a href=\"https://t.co/gsAk8Achuf\">https://t.co/gsAk8Achuf</a></p>&mdash; Javier Garcia (@javierGarciRom) <a href=\"https://twitter.com/javierGarciRom/status/1635373585673121792?ref_src=twsrc%5Etfw\">March 13, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(30,'Bean bag race',NULL,'2023-03-14 21:26:11','2023-03-14 21:26:11','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Beanbag Team Race??<br><br>?️ Activity when done in small teams<br>?️ Can be part of HRE module or a warmup for other modules. <br><br>? Use weighted balls instead of beanbags <br><br>Please retweet if useful ? <a href=\"https://t.co/Yzvw7xHGHz\">pic.twitter.com/Yzvw7xHGHz</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1634846636148154368?ref_src=twsrc%5Etfw\">March 12, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(31,'Pole catch',NULL,'2023-03-14 21:28:46','2023-03-14 21:28:46','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Pole Catch! ?????️<br><br>Groups work cooperatively to catch the poles before they hit the ground.<br><br>Add directional change and increase the distance between each pupil to add challenge.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/E6TfkIUT2I\">pic.twitter.com/E6TfkIUT2I</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1634836326552948736?ref_src=twsrc%5Etfw\">March 12, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(32,'Corner Escape to Victory!',NULL,'2023-03-14 21:32:56','2023-03-14 21:32:56','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Corner Escape to Victory! ??<br><br>Great warm-up game where the prisoner must outwit the guards to touch a cone.<br><br>Rotate the central player and adjust area to suit the group.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/PiDv9MIVfx\">pic.twitter.com/PiDv9MIVfx</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1633710017927847936?ref_src=twsrc%5Etfw\">March 9, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(33,'Bib relays',NULL,'2023-03-16 15:45:30','2023-03-16 15:45:30','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Bib Relays! ???‍♂️?<br><br>The bib acts as a relay baton as teams compete to transport one cone at a time to the pole.<br><br>Next, return the cones to the start line and adjust the distance of the course.<br><br>Efficiency as a team!<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpAE4kM\">https://t.co/zANEpAE4kM</a> <a href=\"https://t.co/oRdcCUordR\">pic.twitter.com/oRdcCUordR</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1635160364659920896?ref_src=twsrc%5Etfw\">March 13, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(34,'Cone Wars',NULL,'2023-03-16 15:47:06','2023-03-18 07:21:53','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Cone wars??<br><br>?️Movements could be linked to most net and wall modules (side shuffle, high to low movements). <br><br>?️ Adding the element of competition will increase engagement. <br><br>? Operate as a league ladder to increase competitiveness.<br><br>Please retweet if useful ? <a href=\"https://t.co/gUAt9ylRhw\">pic.twitter.com/gUAt9ylRhw</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1634864268125548544?ref_src=twsrc%5Etfw\">March 12, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(35,'Sprint drills',NULL,'2023-03-16 15:49:18','2023-03-16 15:49:18','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Sprinting Drills Are Everywhere<br><br>Except Where Most Strength Coaches Look…<br><br>Force Them To Solve At High Speeds<br><br>Not Just Run At Them <a href=\"https://t.co/U4ds0niUPG\">pic.twitter.com/U4ds0niUPG</a></p>&mdash; Austin Jochum (@AustinJochum) <a href=\"https://twitter.com/AustinJochum/status/1635071916167028736?ref_src=twsrc%5Etfw\">March 13, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(36,'Snatching Drill',NULL,'2023-03-16 16:10:26','2023-03-16 16:10:26','<blockquote class=\"instagram-media\" data-instgrm-captioned data-instgrm-permalink=\"https://www.instagram.com/reel/CpVBXGEusNw/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/reel/CpVBXGEusNw/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height