low:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/reel/CpVBXGEusNw/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">A post shared by Rugby JOE (@rugbyjoe)</a></p></div></blockquote> <script async src=\"//www.instagram.com/embed.js\"></script>',''),(37,'Hoola hoop duel',NULL,'2023-03-16 16:12:14','2023-03-16 16:12:14','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Hoola Hoop Dual??<br><br>?️ Great activity to look at endurance &amp; importance of body position. <br>?️ Groups of 3, two competing with a referee.<br><br>?Introduce league ladder <br><br>Please retweet if useful ? <a href=\"https://t.co/OCXVMKpthn\">pic.twitter.com/OCXVMKpthn</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1631544179942920192?ref_src=twsrc%5Etfw\">March 3, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(38,'Handling drill',NULL,'2023-03-16 16:24:32','2023-03-16 16:24:32','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Pass &amp; Follow! ↗️↖️⚽️?<br><br>Large group pass and follow activity that is clever in its design by keeping large numbers active throughout.<br><br>Encourage communication, accuracy and control from all.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/1M6NLOhzrJ\">pic.twitter.com/1M6NLOhzrJ</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1630811324820123648?ref_src=twsrc%5Etfw\">March 1, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(39,'Atletico Madrid Hot Potato Drill',NULL,'2023-03-16 16:29:51','2023-03-16 16:29:51','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Atletico Madrid Hot Potato Tag! ??<br><br>Ball is passed between partners like a hot potato until the command is provided.<br><br>Whoever is in possession must then evade capture towards the finish line.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/lMFC1MJr02\">pic.twitter.com/lMFC1MJr02</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1630081991344369666?ref_src=twsrc%5Etfw\">February 27, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(40,'Cone Harvest',NULL,'2023-03-16 22:05:13','2023-03-16 22:05:13','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Think?React↔️Move?Decelerate↔️Change Directions and COMPETE! <a href=\"https://t.co/kt5a9X1xsZ\">pic.twitter.com/kt5a9X1xsZ</a></p>&mdash; Joe Eisenmann PhD (@Joe_Eisenmann) <a href=\"https://twitter.com/Joe_Eisenmann/status/1549942844797997063?ref_src=twsrc%5Etfw\">July 21, 2022</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(41,'Handball 4 corners, 3 players!',NULL,'2023-03-16 22:13:30','2023-03-16 22:13:30','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Handball 4 corners, 3 players! ??‍♂️?<br><br>Transferable concept that encourages pass and move and decision making.<br><br>Following their pass, pupils must move to the vacant corner of their square.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/1HAzZLRkYJ\">pic.twitter.com/1HAzZLRkYJ</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1633430985864880128?ref_src=twsrc%5Etfw\">March 8, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(42,'Team Tunnels',NULL,'2023-03-18 07:08:32','2023-03-18 07:08:32','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Team Tunnels! ??‍♀️??<br><br>Each pupil assigned a number. <br><br>When their number is called, they complete a lap then move through their team tunnel.<br><br>First pupil to react and steal the cone wins a point for their team.<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/S9Ufjacf8M\">pic.twitter.com/S9Ufjacf8M</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1633348261535686656?ref_src=twsrc%5Etfw\">March 8, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(43,'Cone Snatch',NULL,'2023-03-18 07:22:19','2023-03-18 07:22:19','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Cone Snatch! ??‍♂️??<br><br>Simple concept but a novel way to focus on reaction time and acceleration.<br><br>3pts for a tag, 1pt for avoiding capture.<br><br>Keep score and run as ladder competition. ?<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/qF6IR0eN6T\">pic.twitter.com/qF6IR0eN6T</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1632292926096023553?ref_src=twsrc%5Etfw\">March 5, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(44,'Lateral change of direction',NULL,'2023-03-19 18:43:51','2023-03-19 18:43:51','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">The worlds best lateral change of direction drill. You are welcome <a href=\"https://t.co/NfARSJm7Tv\">pic.twitter.com/NfARSJm7Tv</a></p>&mdash; Max Schmarzo (sbs) (@strong_science) <a href=\"https://twitter.com/strong_science/status/1631332534440140815?ref_src=twsrc%5Etfw\">March 2, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(45,'9 flat cones, 2 tall cones, 3 balls',NULL,'2023-03-21 21:01:52','2023-03-21 21:01:52','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Connect 3??<br><br>?️ 9 flat cones, 2 tall cones, 3 balls<br>?️ First person to have three balls lined on opponents 3 cones wins. <br>?️ Fun warm up that can be 1 of many stations or replicated multiple times for mass participation.<br><br>Please retweet if useful ? <a href=\"https://t.co/tDocymSFGe\">pic.twitter.com/tDocymSFGe</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1638056841518419970?ref_src=twsrc%5Etfw\">March 21, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(46,'Team vs Runner',NULL,'2023-03-21 21:03:11','2023-03-21 21:03:11','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">??Team vs Runner??<br><br>?️ Most effective in groups of 5 (4 passers, 1 runner).<br><br>?️ Team successfully get ball around first, runner does 5 star jumps.<br><br>?️ Runner wins, team do 5 star jumps. <br><br>Can be applied to: <br>? Rugby<br>? Netball<br>? Basketball <br><br>Please retweet if useful ? <a href=\"https://t.co/Dg0VCnLjpe\">pic.twitter.com/Dg0VCnLjpe</a></p>&mdash; PE Teacher Toolkit (@pe_toolkit) <a href=\"https://twitter.com/pe_toolkit/status/1636975807813025792?ref_src=twsrc%5Etfw\">March 18, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(47,'Cainele si osul','<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Drill-ul se face In grupe de cate 4 jucatori. Trei jucatori, dintre care unul este osul, se tin de mana, iar al patrulea este cainele. Scopul &ldquo;cainelui&rdquo; e sa ajunga la os, iar al celorlalti sa protejeze osul</span></p>\r\n<p>&nbsp;</p>','2023-03-21 21:13:46','2023-03-21 21:13:46',NULL,''),(48,'Cone Tag',NULL,'2023-03-25 20:29:33','2023-03-25 20:29:33','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Cone Tag! ????‍♂️?<br><br>Group warm-up focusing on agility, balance and reaction time.<br><br>If your cone is tagged by the central player without being protected, you’re in the middle! <a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/47iJ7GKxwt\">pic.twitter.com/47iJ7GKxwt</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1639528214652395520?ref_src=twsrc%5Etfw\">March 25, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(49,'American Footbal','<p>American Footbal</p>','2023-03-25 22:09:52','2023-03-25 22:09:52',NULL,''),(50,'Agility Drills','<p>Saritura pe 2 picioare in centru, saritura pe un picior lateral</p>\r\n<p>Joc de glezne sau genunchi la piept in centru, saritura pe un picior in lateral</p>\r\n<p>Saritura intr-un picior centru, stanga, centru, dreapta, centru</p>','2023-03-25 22:11:53','2023-05-02 20:55:13','Agility Drills',''),(51,'Indemanare si suport','<p>Grupe de cate 3 jucatori, cu un balon. Grupurile se deplaseaza intr-un perimetru pre-stabilit. Purtatorul de balon trebuie sa \"scape\" de minge la semnal in unul din urmatoarele feluri posibile: aruncat mingea pe spate, aruncat mingea printre picioare, pasa normala stanga sau dreapta, minge lasata pe jos.</p>','2023-03-28 20:38:50','2023-03-28 20:38:50',NULL,''),(52,'Escape & score',NULL,'2023-03-31 21:24:27','2023-03-31 21:24:27','<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Escape &amp; Score! ??<br><br>Decision making and agility put to the test in this activity.<br><br>Set one minute on the clock and see how many tries the central player can score. Rotate roles and repeat!<a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/1t8OEBeQW6\">pic.twitter.com/1t8OEBeQW6</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1641679056847482882?ref_src=twsrc%5Etfw\">March 31, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',''),(53,'Spin pass','<p>Spin pass</p>','2023-04-18 19:41:38','2023-04-18 19:41:38',NULL,''),(54,'Placaj 1v1','<p>Jucatorii pleaca fata in fata. Unul e purtator de balon, celalalt e placheur.</p>\r\n<p>Puratorul de balon trebuie sa atace una din partile placheurului. Acesta trebuie sa-l opreasca</p>','2023-05-02 20:58:22','2023-05-02 20:58:22',NULL,''),(55,'Soimii si porumbeii','<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Jucatorii trebuie sa parcurga un perimetru fara sa fie atinsi sau fara sa li se ia tagul de catre uliul. Cand nu mai au vieti devin la randul lor ulii.&nbsp;</span></p>\r\n<p>&nbsp;</p>','2023-05-09 15:08:46','2023-05-09 15:08:46',NULL,''),(56,'Sprint liniar cu pornire dinamica','<p>3 conuri sunt asezate in linie. Distanta dintre primele 2 conuri reprezinta zona intiala de miscare, iar distanta dintre al doilea si al treilea con reprezinta zona de accelerare. Atletul poate parcurge distanta dintre primele doua conuri in feluri diferite. Spre exemplu, mersul ursului, pasul strengarului, alergare usoara, mers normal.</p>','2023-05-23 20:40:09','2023-05-23 20:43:09',NULL,''),(57,'Invazia','<p>Avem un numar de cuiburi de aparat si cu un aparator mai putin. Atacatori trebuie sa arunce un tricou sau un alt obiect de antrenament in cuib fara sa fie atinsi de aparatori. Daca sunt atinci de aparatori trebuie sa arunce obiectul pe locul unde au fost atinsi.</p>','2023-05-23 20:48:48','2023-05-23 20:48:48',NULL,''),(58,'2vs1','<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Jucatorii pleaca din acelasi loc, 2 intr-o parte, atacul si unul in cealalta, apararea. Mingea e pasata de catre antrenor unuia din jucatorii din atac. Acesta trebuie sa inainteze cu mingea si sa-i paseze colegului de atac inainte de a fi atins de aparator.</span></p>\r\n<p>&nbsp;</p>','2023-06-10 15:51:32','2023-06-10 15:51:32',NULL,''),(59,'3vs2','<p>Atac 3 impotriva 2</p>','2023-06-10 15:52:45','2023-06-10 15:52:45',NULL,''),(60,'Cruce','<p>Purtatorul de balon inainteaza apoi schimba directia spre colegul sau. In acelasi moment colegul isi schimba directia de alergare spre purtatorul de balon. Atunci cand sa intalnesc&nbsp; la jumatatea distantei, purtatorul de balon ii paseaza mingea colegului sau.</p>','2023-06-10 15:56:41','2023-06-10 15:56:41',NULL,''),(61,'Praise talk','<p>Spune un lucru bun despre un coleg de-al tau. Colegul trebuie sa spuna un lucru bun despre altcineva.</p>\r\n<p>Castigatorul de la Super Mario primeste o lauda si o critica de la ceilalti jucatori.</p>\r\n<p>&nbsp;</p>','2023-06-10 16:15:47','2023-06-10 16:15:47',NULL,''),(62,'Roata','<p>Jucatorii se aseaza in cerc, fiecare avand o minge in mana. La un semn arunca mingea in sus si misca in stanga sau in dreapta, prinzand mingea colegului.</p>','2023-06-28 12:02:07','2023-06-28 12:02:07',NULL,''),(63,'Space Awareness Game 1','<p>In a given area, we have up to six lights. Players get to choose their color of choice. We can have multiple players with the same color if there are more then 6 participants. Each player needs to reach the pod showing their color. When somebody reaches the pod, the pod colors are reset and the game restarts.</p>\r\n<p>Change area size.</p>\r\n<p>Add obstacles.</p>\r\n<p>Add moving obstacles with shields.</p>\r\n<p>Add balls to the game. Make it mandatory to have a ball before reaching the pod and to shoot it after the pod is reached by somebody.</p>\r\n<p>&nbsp;</p>','2023-10-29 10:56:05','2023-10-30 16:58:23',NULL,'videos/byBzbg8wApLvjfLTdjlz2bBDge0BkwoycQB4x7b7.mp4'),(64,'Dodge ball','<p>Scopul jocului este eliminarea tuturor jucatorilor adversi prin nimerirea lor cu mingea</p>','2024-01-05 21:17:18','2024-01-05 21:17:18',NULL,NULL),(65,'Defensive line coordination','<p>Tie the users with easy breakable string or same them hold one. Create a line of players this was. The attacking team must find ways to avoid the defensive line. The defensive line can be broken in place to encourgae the attacking team to find spaces&nbsp; in the line not just ways to avoid it</p>','2024-02-03 09:49:05','2024-02-03 09:49:05',NULL,NULL),(66,'Leapsa','<p>leapsa</p>','2024-02-28 14:22:45','2024-02-28 14:22:45',NULL,NULL),(67,'Sprint races','<p>Speed race with various starting scenarios.</p>\r\n<ol>\r\n<li>Plank.</li>\r\n<li>5 push-ups</li>\r\n<li>Lateral jump over fence&nbsp;</li>\r\n<li>Legs up</li>\r\n<li>Bear crawl</li>\r\n<li>Lying face up / down</li>\r\n<li>Crounch under obstacle</li>\r\n<li>Roll</li>\r\n</ol>\r\n<p>Stop in the middle of the race to pickup a rugby ball.</p>\r\n<p>Finish with a jump and close a light</p>','2024-03-16 09:36:15','2024-03-16 09:36:15',NULL,NULL),(68,'Lupta ursilor','<p>Adversarii se misca ca ursul si incearca sa-si dezichilibreze adversarul</p>','2024-03-30 09:36:23','2024-03-30 09:36:23',NULL,NULL),(69,'Lupta cocosilor','<p>Cu mainile la spate, adversarii incearca sa-si scoata adversarul dintr-un cerc</p>','2024-03-30 09:38:09','2024-03-30 09:38:09',NULL,NULL),(70,'Bear football','<p>Using only bear walk, play football without a goal keeper</p>','2024-05-25 19:33:28','2024-05-25 19:33:28',NULL,NULL),(71,'Baseball','<p>Varianta simplificata de baseball. Jucatorul trebuie sa loveasca mingea ca sa poata alerga in linie dreapta o anumita stabilita in prealabil</p>','2024-06-22 07:27:06','2024-06-22 07:27:06',NULL,NULL),(72,'Touch Rugby','<p>Numar nelimitat de atacuri</p>\r\n<p>Atins cu doua maini</p>\r\n<p>Retras in spatele liniei de ruck</p>','2024-11-13 07:10:47','2024-11-13 07:10:47',NULL,NULL),(73,'Magarusul','<p>Se impart participantii in doua echipe. Scopul unei echipe e sa realizeze 10 pase consecutive. Jucatorul care are mingea nu are voie sa se deplaseze, dar are voie sa se invarta pe loc pentru a gasi un coleg caruia sa-i paseze.</p>','2025-01-07 20:11:12','2025-01-07 20:11:12',NULL,NULL),(74,'Speed drills','<p>Sarituri intr-un picior, trei in fata una in spate</p>\r\n<p>Sarituri intr-un picior, trei in fata a 4&nbsp; in sus</p>\r\n<p>Sarituri in doua picioare cu ridicare genunchi</p>\r\n<p>Fandare, saritura, aterizare in fandare</p>\r\n<p>Sarituri laterale in doua picioare</p>\r\n<p>Sarituri laterale intr-un picior</p>','2025-01-11 19:34:24','2025-01-11 19:35:30','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">Soccer players must play soccer to get better at soccer; however, quickly addressing simple things that improve ability to move and energy efficiency should be taking advantage of. Day 2 <a href=\"https://twitter.com/ECNLboys?ref_src=twsrc%5Etfw\">@ECNLboys</a> NTC. Learning how to progress 1L RFD and braking capacity for agility <a href=\"https://t.co/iZQ82PRvSs\">pic.twitter.com/iZQ82PRvSs</a></p>&mdash; HoundsSpeed + (@houndsspeed) <a href=\"https://twitter.com/houndsspeed/status/1555575645656211456?ref_src=twsrc%5Etfw\">August 5, 2022</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(75,'3 man drive','<p>Concurs cu 3 man drive.</p>','2025-01-11 19:42:24','2025-01-11 19:43:11',NULL,NULL),(76,'Dirty Footballer','<p>Alege aleator un jucator care sa arunce cu mingea. Ceilalti participanti trebuie sa fuga.</p>','2025-01-11 19:52:16','2025-01-11 19:52:16','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">This challenge is brilliant ? <a href=\"https://t.co/AiVavAWlWw\">pic.twitter.com/AiVavAWlWw</a></p>&mdash; Dirty Footballer ? (@DirtyFootbaIIer) <a href=\"https://twitter.com/DirtyFootbaIIer/status/1702329101821083936?ref_src=twsrc%5Etfw\">September 14, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(77,'The countries',NULL,'2025-01-24 09:19:39','2025-01-24 09:19:39','Each player represents a country. In alphabetical order, each player gets his turn to throw the ball. When he throws the ball, he will name one of the other countries. The player named will have to gather the ball and yell stop. The other players, the ones that were not called will have to run as far away as possible from the player with the ball. When they stop, the player with the ball can make 3 giant steps to get closer to the player he wants to catch. He will then throw the ball at him. The player is not allowed to move',NULL),(78,'Handling races','<p>Two players are competing against each other. Their aim is to get to the finish line before the opponent, but they need to collect a ball before.</p>\r\n<p>The ball can be passed, dropped on the floor, thrown randomly.</p>','2025-01-24 09:34:37','2025-01-24 09:34:37',NULL,NULL),(79,'Speed drills 2',NULL,'2025-01-30 20:03:19','2025-01-30 20:03:35','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">For multi-directional speed based athletes eccentric capacity should be primarily challenged with velocity. The only thing to prepare an athlete to yield under speed is speed itself <a href=\"https://twitter.com/hashtag/LTAD?src=hash&amp;ref_src=twsrc%5Etfw\">#LTAD</a> <a href=\"https://t.co/TaA61IxgWK\">pic.twitter.com/TaA61IxgWK</a></p>&mdash; HoundsSpeed + (@houndsspeed) <a href=\"https://twitter.com/houndsspeed/status/1720150688226058478?ref_src=twsrc%5Etfw\">November 2, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(80,'Takeoffs and landings',NULL,'2025-02-06 21:46:29','2025-02-06 21:46:29','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/ACL?src=hash&amp;ref_src=twsrc%5Etfw\">#ACL</a> prevention in female soccer starts at youngest ages with progressive exposure to more intense, complex takeoffs and landings. These impacts are supported by specific relative strengths that promote self awareness and total body control through full ROM <a href=\"https://twitter.com/hashtag/LTAD?src=hash&amp;ref_src=twsrc%5Etfw\">#LTAD</a> <a href=\"https://t.co/acVgXVYD69\">pic.twitter.com/acVgXVYD69</a></p>&mdash; HoundsSpeed + (@houndsspeed) <a href=\"https://twitter.com/houndsspeed/status/1692009845002531281?ref_src=twsrc%5Etfw\">August 17, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(81,'Speed drills 3',NULL,'2025-02-06 21:51:29','2025-02-06 21:51:29','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">USL Acad #13 (24 hrs. post comp)<br> -Lateral/Backwards plyos to lessen <br> impact<br> &gt;60 min players dynamic warmup,<br> extensive plyos <br> &lt;60 min players extensive, lateral <br> intensive <br>Prefer RSI to momentary demo RFD<a href=\"https://twitter.com/hashtag/LTAD?src=hash&amp;ref_src=twsrc%5Etfw\">#LTAD</a> <a href=\"https://twitter.com/hashtag/ACLprevention?src=hash&amp;ref_src=twsrc%5Etfw\">#ACLprevention</a> <a href=\"https://t.co/nqK0Ka64rG\">pic.twitter.com/nqK0Ka64rG</a></p>&mdash; HoundsSpeed + (@houndsspeed) <a href=\"https://twitter.com/houndsspeed/status/1681048651848663042?ref_src=twsrc%5Etfw\">July 17, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(82,'Ball tag',NULL,'2025-02-06 21:56:29','2025-02-06 21:56:29','<blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">Florida Gators Ball Tag! ?????<br><br>Passing team can’t move with the ball.<br><br>Can the evading player survive 30 seconds without capture?<br><br>Enrol on our <a href=\"https://twitter.com/ISFsports?ref_src=twsrc%5Etfw\">@ISFsports</a> course for PE Teachers today! ??<a href=\"https://t.co/oVcYkMgYny\">https://t.co/oVcYkMgYny</a><a href=\"https://twitter.com/WannaTeachPE?ref_src=twsrc%5Etfw\">@WannaTeachPE</a> is out now! ???<a href=\"https://t.co/zANEpADwve\">https://t.co/zANEpADwve</a> <a href=\"https://t.co/CQzgRgdSg2\">pic.twitter.com/CQzgRgdSg2</a></p>&mdash; WannaTeachPE (@WannaTeachPE) <a href=\"https://twitter.com/WannaTeachPE/status/1674278400490459136?ref_src=twsrc%5Etfw\">June 29, 2023</a></blockquote> <script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script>',NULL),(83,'Speed drill 4','<p><a href=\"https://www.facebook.com/share/r/1BdFypSVdD/\" target=\"_blank\" rel=\"noopener\">https://www.facebook.com/share/r/1BdFypSVdD/</a></p>','2025-03-12 15:32:09','2025-03-12 15:34:26',NULL,NULL);
